          <ul class="navbar-nav mr-auto">
          <li className="nav-item">
              <Link to="/sellerlogin" className="nav-link">
                Login as Seller
              </Link>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/buyerlogin">Login as Buyer</a>
            </li>
            <li class="nav-item">
              <a class="nav-link " href="/aggregatorlogin" onClick={openLoginModal}>Login as Aggregator</a>
            </li>
          </ul>
          <LoginModal open={isLoginModalOpen} onClose={closeLoginModal} />
        </div>
      </nav>
    </nav>
  )
}

export default Navbar;
